script: |
  super -f text -I q11086.spq | sort > q11086.out

inputs:
  - name: q11086.spq
    data: |
      SELECT - col1 / col1 AS col0 FROM tab0 (FORMAT parquet) WHERE ( col1 ) * - 77 NOT BETWEEN 73 AND - col2 + col2;
  - name: tab0

outputs:
  - name: q11086.out
    data: |
      -1
      -1
      -1
